import React from 'react';
interface CardProps {
  title: string;
}

const Card: React.FC<CardProps> = ({ title }) => {
  const imageUrl = process.env.PUBLIC_URL + `/PlayingCards/${title}`;

  return (
      <img src={imageUrl} alt={title} className="w-5" />
  );
};



export default Card;
